import "./styles.css";

function header(){
  return <header><h1>ExchangeRat</h1></header>;
}

function userInput(){
  return (
    <label>
      文本框：<input name="myInput" />
    </label>
  );
}

function Converter(){
  return (
    <>
    <div className="Converter">
    <div className="Converter-title">Converter</div>
    <div className="Converter-body">
      <userInput />
      <userInput />
    </div>
    </div>
    </>
  );
}

export default function App(){
  return (
    <>
    <div className="App">
      <div><header/></div>
      <main><div><Converter/></div></main>
    </div>
    </>
  );
}
